    TResult Function(QueryError value)? queryError,
    TResult Function(_CurrentUserUnavailable value)? currentUserUnavailable,
    TResult Function(UploadError value)? uploadError,
    TResult Function(ServerError value)? serverError,
    required TResult orElse(),
  }) {
    if (serverError != null) {
      return serverError(this);
    }
    return orElse();
  }
}

abstract class ServerError implements UsersFailure {
  const factory ServerError() = _$ServerError;
}
